import React from 'react';
import Header from './components/Header';
import PatientForm from './components/PatientForm';
import PatientList from './components/PatientList';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <PatientForm />
      <PatientList />
    </div>
  );
}

export default App;
